import React from 'react'
import {Link} from "react-router-dom";
import BannerImage from '../images/74368198-51734028.jpg';
import "../style/"

function Header() {
  return (
    <div className='home'>
    <div className='header' 
  style={{ backgroundImage: `url(${BannerImage})` }}
    >  
        <h1> Enactus</h1>
        <p>Enactus FSBM rassemble des étudiants pour décelopper des prijets innovants ayant un impact positif sur la société.</p>
        <Link to="/Apropos">
        <button>SAVOIR PLUS</button>
        </Link>
    </div>
    </div>
  )
}

export default Header;
